import React from 'react';
import loadingIcon from './loading-icon3.gif';

const LoadingIcon = () => (
  <div className="text-center rounded-full overflow-hidden">
    <img className="inline rounded-full h-16 w-16 flex items-center justify-center" src={loadingIcon} width="96" height="96" alt="Loading icon" />
  </div>
);

export default LoadingIcon;
